CREATE TABLE accesos(  id bigint,  idusuarios bigint,  idmenu (  id ,  nombre ,  icono ,  idpadre ,  idsistema ,  ruta ,  orden ,  color ) bigint,  idsistema bigint,  idcontrolador bigint);
CREATE TABLE actividad( id bigint,  nombre text);
CREATE TABLE controladores(  id bigint,  nombre text,  hpadre bigint,  hmenu (  id ,  nombre ,  icono ,  idpadre ,  idsistema ,  ruta ,  orden ,  color ) bigint,  idsistema bigint);
CREATE TABLE auditcontroladores(id bigint,  idcontrolador bigint,  idsistema bigint,  idusuario bigint,  fecha timestamp without time zone,  actividad bigint,  idsesion bigint);
CREATE TABLE estados(  id bigint NOT NULL,  nombre text,  region character(10));
CREATE TABLE localidades(  id bigint,  nombre text,  idparroquia bigint,  idestado bigint,  idmunicipio bigint);
CREATE TABLE menu (  id ,  nombre ,  icono ,  idpadre ,  idsistema ,  ruta ,  orden ,  color )(  id bigint,  nombre text,  icono text,  idpadre bigint,  idsistema bigint,  ruta text,  orden bigint,  color text);
CREATE TABLE municipios(  id bigint NOT NULL,  nombre text,  idestado bigint);
CREATE TABLE parroquias(  id bigint NOT NULL,  nombre text,  idmunicipio bigint,  idestado bigint);
CREATE TABLE sysusuarios(  id bigint,  idsistema bigint,  idusuario bigint);
CREATE TABLE usuarios(  id bigint,  nombre text,  login character(8),  clave text,  idsistema bigint,  estatus bigint);
